import './App.css';
import Swatch from './components/Swatch'

function App() {

  return (
    <>
      <script src="https://www.w3schools.com/lib/w3color.js" />
      <Swatch cyan={44} magenta={55} yellow={0} black={0} />
    </>
  );
}

export default App;
